    "2016-05-25T00:28:48.552502",nt"name": "its-deployment-statistics-arterial-management-agency-characteristics-2010-516fc",nt"isopen":
    true,nt"url": null,nt"notes": "This data contains the results of the national
    2010 Intelligent Transportation System (ITS) Deployment Tracking Survey. The survey
    covered nearly 1600 transportation agencies in 108 cities. Surveys were distributed
    targeting seven transportation agency types: Freeway Management, Arterial Management,
    Transit Management, Transportation Management Center (TMC), Electronic Toll Collection
    (ETC), Public Safety - Law Enforcement, and Public Safety - Fire/Rescue. Two types
    of data were collected in the 2010 survey: opinions from agencies, and deployment
    information. Users can download various summary reports as well as the entire survey
    database through the website.",nt"license_title": "U.S. Government Work",nt"extras":
